import React from 'react';
import styles from '../css/HeroSection.module.css'; // Import CSS module

const HeroSection = () => {
  return (
    <section className={styles.heroSection}>
      <div className={styles.heroContent}>
        <h2 className={styles.heroTitle}>Tu confianza nuestra fortaleza; tu seguridad, nuestra prioridad.</h2>
        <p className={styles.heroDescription}>En un mundo cada vez más interconectado, nuestra empresa de ciberseguridad se compromete a proteger tus datos y privacidad, brindándote soluciones avanzadas y una defensa integral contra las amenazas.</p>
        <button className={styles.ctaButton}>Prueba de escaneo gratuita</button>
      </div>
      <div className={styles.heroImage}>
        <img className={styles.heroImg} src="https://i.blogs.es/8122e1/istock-1194430863/1366_2000.jpeg" alt="Hero"/>
      </div>
    </section>
  );
};

export default HeroSection;
